import logo from "./logo.svg";
import "./App.css";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import DetailBooking from "../src/page/detailBooking";

function App() {
  return (
    <Router>
      <Route path="/bookings/thisweek" component={<DetailBooking />} />

      <Route path="/bookings/thisweek/:roomId" component={<DetailBooking />} />
    </Router>
  );
}

export default App;
